import contentRegister from "./content/contentRegister.vue";
import { mapState } from 'vuex';

export default {
  name: "wzsknProcessing",
  components: { contentProof, contentRegister },
  data () {
    return {
      activeContent: 'content1'
    };
  },
  computed: {
    ...mapState({
      dt_business_type_screenGroupNum_knjg: state => state.businessComponent.dt_business_type_screenGroupNum_knjg
    })
  },
  mounted () {
    this.$store.dispatch('businessComponent/getBusinessComponentData', ['dt_business_type_screenGroupNum_knjg']);
    this.getBusinessTypeList();
  },
  methods: {
    refreshProof () {
      this.$refs.cproof.getList();
    },
    getBusinessTypeList () {
      setTimeout(() => {
        this.$refs.cregister.businessTypeList = this.dt_business_type_screenGroupNum_knjg;
        this.$refs.cproof.businessTypeList = this.dt_business_type_screenGroupNum_knjg;
      }, 500);
    }
  }
